commits.content:
.logo {
  margin-right: auto;
  z-index: 9999;
  display: flex;
  flex-direction: column;

  .logoHeading {
    font-size: 24px;
    font-family: "Inter";
    font-weight: 400;

    .spanOne {
      color: var(--primary);
      font-weight: 700;
    }

    .spanTwo {
      color: var(--secondary);
      font-weight: 700;
    }
  }

  .logoSubheading {
    transform: translateY(-12px);
    display: inline-block;
    font-size: 13px;
    font-weight: 200;

    span {
      color: var(--primary);
      font-weight: 700;
    }
  }
}

@media (max-width: 639px) {
  .logo {
    .logoHeading {
      font-size: 20px;
    }

    .logoSubheading {
      font-size: 10px;
    }
  }
}

@media (max-width: 281px) {
  .wrapper {
    .logo {
      .logoHeading {
        font-size: 18px;
      }

      .logoSubheading {
        font-size: 8px;
      }
    }
  }
}
